import React, { Component } from 'react';
import logo from './bad.png';
import logo2 from './cc.png';
import './App.css';
import RangeSliderLadder from './rangeslider_ladder';



class App extends Component {
  render () {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} alt='whoops'/>
          <p>Which Test Kitchen Staffer Do You Vibe With Best?*</p>
          <RangeSliderLadder />
          <img src={logo2} alt='whoops'/>
          <p class='blah'>*Scientifically calculated using R^10 Euclidean Norm of your answers & the TK staff's responses in:</p>
          <a class='blah' href='https://www.youtube.com/watch?v=_ykjy61GwcE'>Pro Chefs Rate Foods from 1-100 | Test Kitchen Talks @ Home | Bon App√©tit</a>
        </header>
      </div>
    );
  }
}

export default App;
